import "./App.css";
import TodoPage from "./pages/TodoPage";
import Home from "./pages/Home";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/todos/:date" element={<TodoPage />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
